  zIndex: 20,
  placementProps,
  px: 4,
  py: 4
};
const defaultProps = {
  renderInPortal: true,
  variant: 'solid',
  colorScheme: 'primary',
  placement: 'bottom-right'
};
export default {
  baseStyle,
  defaultProps
};
